import React from "react";
import Header from "../utils/header";
import Banner from "../components/solutions/banner";
import PaperInvoices from "../components/solutions/paperInvoices";
import BusinessSolution from "../components/home/businessSolution";
const Solution = ({ bg }) => {
  return (
    <div>
      <Header />
      <BusinessSolution
        bg={bg}
        style={{ backgroundColor: bg ? "black" : "white" }}
      />
      <PaperInvoices />
    </div>
  );
};

export default Solution;
